svg.script:
/**
 * Get and log to console mouse coordinates on click.
 */
(function() {
   let svg = document.documentElement;

   //let textElem = document.getElementById("mouse-coords");

   function getSVGCoords(evt) {
         let pt = svg.createSVGPoint();
         pt.x = evt.clientX;
         pt.y = evt.clientY;
         let transformed = pt.matrixTransform(svg.getScreenCTM().inverse());
         let textContent = `x: ${transformed.x.toFixed(2)}, y: ${transformed.y.toFixed(2)}`;
         console.log( textContent );
   }

   svg.addEventListener("click", getSVGCoords);

})();
